import React, { Component } from 'react';
import "react-router";
import {
  BrowserRouter,
  Route,
  Link
} from 'react-router-dom'
import axios from 'axios';

class GameStats extends Component {
	constructor(props) {
      super(props);
      this.state = {
        statsList:[]
        // [{gameId:'1',level:'easy',timeRBS:'5',timeNRBS:'6',timeLS:'1'},{gameId:'2',level:'easy',timeRBS:'6',timeNRBS:'7',timeLS:'8'},
      // {gameId:'4',level:'medium',timeRBS:'51',timeNRBS:'6',timeLS:'1'},{gameId:'5',level:'hard',timeRBS:'62',timeNRBS:'7',timeLS:'8'},]
    };
  }

  componentDidMount(){
      axios.get('http://localhost:8000/stats')
        .then(response => {
          console.log('p',response.data );
          this.setState({ statsList: response.data });
        })
        .catch(function (error) {
          console.log(error);
        })
    }
  render(){
    const listItems = this.state.statsList.map((stat, index) => {
      return  <tr key={index}>
                <td>{stat.gameId}</td> <td>{stat.level}</td>  <td>{stat.timeRBS}</td> <td>{stat.timeNRBS}</td> <td>{stat.timeLS}</td>
              </tr>
      });
		return (
      <div>
        <h1>Game Stats</h1>
        <table id="customerTable" >
						<thead>
							<tr>
								<th>Game Id</th>
                <th>Level</th>
                <th>RBS(ms)</th>
                <th>NRBS(ms)</th>
                <th>LS(ms)</th>
							</tr>
						</thead>
						<tbody>
              {listItems}
            </tbody>
        </table>
        <p>Solver times in ms. </p>
        <p>RBS: Recursive Backtracking Solver. </p>
        <p>NRBS: Non-Recursive Backtracking Solver. </p>
        <p>LS: Strategy-based Logical Solver.</p>
      </div>
		)
	}
}
export default GameStats;
